import React from "react";
import '@fortawesome/free-regular-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBriefcase } from '@fortawesome/free-solid-svg-icons';
import { faGraduationCap } from '@fortawesome/free-solid-svg-icons';
import { VerticalTimeline, VerticalTimelineElement }  from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';
import '../assets/styles/Timeline.scss'

function Timeline() {
  return (
    <div id="history">
      <div className="items-container">
        <h1>Career History</h1>
        <VerticalTimeline>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            contentStyle={{ background: 'white', color: 'rgb(39, 40, 34)' }}
            contentArrowStyle={{ borderRight: '7px solid  white' }}
            date="August 2023 - present"
            iconStyle={{ background: '#5000ca', color: 'rgb(39, 40, 34)' }}
            icon={<FontAwesomeIcon icon={faGraduationCap} />}
          >
            <h3 className="vertical-timeline-element-title">Master of Science in Computer Science</h3>
            <h5 className="vertical-timeline-element-subtitle">Binghamton University, State University of New York</h5>
            <p>
            Artificial Intelligence, Design & Analysis Comp Algorithm, Operating System, Database Systems, Computer Security
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            date="June 2021 - July 2023"
            iconStyle={{ background: '#5000ca', color: 'rgb(39, 40, 34)' }}
            icon={<FontAwesomeIcon icon={faBriefcase} />}
          >
            <h3 className="vertical-timeline-element-title">Software Engineer</h3>
            <h5 className="vertical-timeline-element-subtitle">LTIMindtree, Mumbai, India</h5>
            <p>
            I fostered the development of the "OneView" interactive dashboard for a banking client, utilizing Tableau and Power BI to provide comprehensive data visualization. 
            I headed the overhaul of data processes, significantly reducing manual intervention and enhancing data accuracy. 
            This improvement enabled dynamic ad-hoc data analyses, leading to impactful business recommendations. 
            Additionally, I pioneered a semi-automated data processing system using Python, revolutionizing the extraction and filtration of diverse CSV raw files. 
            By leveraging PostgreSQL, I engineered a robust solution to populate and maintain refined data, ensuring optimal data integrity and accessibility. 
            This initiative resulted in a 30% reduction in data-related errors and improved the decision-making process for the team. 
            Furthermore, I created user-friendly UI pages using Flask frameworks, empowering real-time data interaction through seamless commenting and editing functionalities for an enhanced user experience.
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            date="August 2017 - May 2021"
            iconStyle={{ background: '#5000ca', color: 'rgb(39, 40, 34)' }}
            icon={<FontAwesomeIcon icon={faGraduationCap} />}
          >
            <h3 className="vertical-timeline-element-title">Bachelor of Technology in Information Technology </h3>
            <h5 className="vertical-timeline-element-subtitle">University of Mumbai, Mumbai, India</h5>
            <p>
              Data Structures, Algorithms, Artificial Intelligence, Database Management, Software Engineering
            </p>
          </VerticalTimelineElement>
        </VerticalTimeline>
      </div>
    </div>
  );
}

export default Timeline;
